// src/pages/member/ComplaintsPage.js
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './ComplaintsPage.css';

const MemberComplaintsPage = () => {
  const navigate = useNavigate();
  const [stats, setStats] = useState({
    myComplaints: 5,
    open: 2,
    inProgress: 1,
    resolved: 2
  });
  const [complaints, setComplaints] = useState([]);
  const [showNewComplaintForm, setShowNewComplaintForm] = useState(false);
  const [newComplaint, setNewComplaint] = useState({
    category: '',
    subject: '',
    description: ''
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const mockComplaints = [
      {
        id: 'C001',
        category: 'Plumbing',
        subject: 'Leaking kitchen sink',
        description: 'The kitchen sink has been leaking for the past two days.',
        date: '25/10/2025',
        status: 'open',
        response: 'We have received your complaint and will address it soon.'
      },
      {
        id: 'C002',
        category: 'Electrical',
        subject: 'Power outage in bedroom',
        description: 'Frequent power outages in the master bedroom.',
        date: '24/10/2025',
        status: 'in-progress',
        response: 'Electrician will visit tomorrow between 10AM-12PM.'
      },
      {
        id: 'C003',
        category: 'Noise',
        subject: 'Loud music from upstairs',
        description: 'Upstairs neighbors playing loud music late at night.',
        date: '23/10/2025',
        status: 'resolved',
        response: 'Issue has been resolved. Thank you for your patience.'
      }
    ];

    setTimeout(() => {
      setComplaints(mockComplaints);
      setLoading(false);
    }, 1000);
  }, []);

  const handleNewComplaint = () => {
    setShowNewComplaintForm(true);
  };

  const handleSubmitComplaint = (e) => {
    e.preventDefault();
    const newId = `C${String(complaints.length + 1).padStart(3, '0')}`;
    const complaint = {
      id: newId,
      ...newComplaint,
      date: new Date().toLocaleDateString('en-GB'),
      status: 'open',
      response: 'Your complaint has been submitted successfully.'
    };
    setComplaints([complaint, ...complaints]);
    setNewComplaint({ category: '', subject: '', description: '' });
    setShowNewComplaintForm(false);
    alert('投诉已成功提交！');
  };

  const getStatusBadge = (status) => {
    const badges = {
      open: { class: 'open', text: 'OPEN' },
      'in-progress': { class: 'in-progress', text: 'IN PROGRESS' },
      resolved: { class: 'resolved', text: 'RESOLVED' }
    };
    return badges[status] || badges.open;
  };

  return (
    <div className="member-complaints-page">
      <div className="page-header">
        <button className="back-btn" onClick={() => navigate('/member')}>
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#333">
            <path d="M20,11V13H8L13.5,18.5L12.08,19.92L4.16,12L12.08,4.08L13.5,5.5L8,11H20Z"/>
          </svg>
          Back to Dashboard
        </button>
        <h1>My Complaints</h1>
        <p>Track and manage your complaints</p>
      </div>

      {loading ? (
        <div className="loading-container">
          <div className="spinner"></div>
        </div>
      ) : (
        <>
          <div className="stats-grid">
            <div className="stat-card primary">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M14,2H6A2,2 0 0,0 4,4V20A2,2 0 0,0 6,22H18A2,2 0 0,0 20,20V8L14,2M18,20H6V4H13V9H18V20Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>Total Complaints</h3>
                <p className="stat-value">{stats.myComplaints}</p>
              </div>
            </div>

            <div className="stat-card warning">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M13,13H11V7H13M13,17H11V15H13M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>Open</h3>
                <p className="stat-value">{stats.open}</p>
              </div>
            </div>

            <div className="stat-card info">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2M12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4M12,6A6,6 0 0,0 6,12A6,6 0 0,0 12,18A6,6 0 0,0 18,12A6,6 0 0,0 12,6M12,8A4,4 0 0,1 16,12A4,4 0 0,1 12,16A4,4 0 0,1 8,12A4,4 0 0,1 12,8Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>In Progress</h3>
                <p className="stat-value">{stats.inProgress}</p>
              </div>
            </div>

            <div className="stat-card success">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2M12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4M11,16.5L6.5,12L7.91,10.59L11,13.67L16.59,8.09L18,9.5L11,16.5Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>Resolved</h3>
                <p className="stat-value">{stats.resolved}</p>
              </div>
            </div>
          </div>

          <div className="page-actions">
            <button className="action-btn primary" onClick={handleNewComplaint}>
              <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
                <path d="M19,13H13V19H11V13H5V11H11V5H13V11H19V13Z"/>
              </svg>
              File New Complaint
            </button>
          </div>

          {showNewComplaintForm && (
            <div className="new-complaint-form">
              <div className="form-header">
                <h2>File New Complaint</h2>
                <button className="close-btn" onClick={() => setShowNewComplaintForm(false)}>
                  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#333">
                    <path d="M19,6.41L17.59,5L12,10.59L6.41,5L5,6.41L10.59,12L5,17.59L6.41,19L12,13.41L17.59,19L19,17.59L13.41,12L19,6.41Z"/>
                  </svg>
                </button>
              </div>
              <form onSubmit={handleSubmitComplaint}>
                <div className="form-group">
                  <label>Category</label>
                  <select
                    value={newComplaint.category}
                    onChange={(e) => setNewComplaint({...newComplaint, category: e.target.value})}
                    required
                  >
                    <option value="">Select Category</option>
                    <option value="Plumbing">Plumbing</option>
                    <option value="Electrical">Electrical</option>
                    <option value="Maintenance">Maintenance</option>
                    <option value="Security">Security</option>
                    <option value="Noise">Noise</option>
                    <option value="Other">Other</option>
                  </select>
                </div>
                <div className="form-group">
                  <label>Subject</label>
                  <input
                    type="text"
                    value={newComplaint.subject}
                    onChange={(e) => setNewComplaint({...newComplaint, subject: e.target.value})}
                    required
                  />
                </div>
                <div className="form-group">
                  <label>Description</label>
                  <textarea
                    value={newComplaint.description}
                    onChange={(e) => setNewComplaint({...newComplaint, description: e.target.value})}
                    rows="4"
                    required
                  ></textarea>
                </div>
                <div className="form-actions">
                  <button type="submit" className="submit-btn">Submit Complaint</button>
                  <button type="button" className="cancel-btn" onClick={() => setShowNewComplaintForm(false)}>
                    Cancel
                  </button>
                </div>
              </form>
            </div>
          )}

          <div className="complaints-container">
            <div className="container-header">
              <h2>My Complaints</h2>
            </div>

            <div className="complaints-list">
              {complaints.map(complaint => (
                <div key={complaint.id} className="complaint-item">
                  <div className="complaint-header">
                    <div className="complaint-info">
                      <h3>{complaint.subject}</h3>
                      <div className="complaint-meta">
                        <span className="complaint-id">ID: {complaint.id}</span>
                        <span className="complaint-category">{complaint.category}</span>
                        <span className="complaint-date">{complaint.date}</span>
                      </div>
                    </div>
                    <span className={`status-badge ${getStatusBadge(complaint.status).class}`}>
                      {getStatusBadge(complaint.status).text}
                    </span>
                  </div>
                  <p className="complaint-description">{complaint.description}</p>
                  <div className="complaint-response">
                    <h4>Admin Response:</h4>
                    <p>{complaint.response}</p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default MemberComplaintsPage;
